}

export default dbModel

import m from 'mithril'

import dbModel from './db'
import cityModel from './city'
import utilitiesModel from './utilities'
const axios = require('axios')

const userModel = {
  historyMode: 'history',
  currentUser: {},
  filteredHistory: {},
  authorized: false,
  changePayment: false,
  selectedPaymentMethod: 'Direct',
  changeHistoryMode: () => {
    userModel.historyMode = (userModel.historyMode === 'history') ? 'invoice' : 'history'
  },
  changePaymentMethod: async () => {
    await dbModel.updateUser({ paymentmethod: userModel.selectedPaymentMethod })
    userModel.currentUser = await dbModel.getUser(userModel.currentUser.email)

    userModel.changePayment = false
    userModel.selectedPaymentMethod = 'Direct'
    m.redraw()
  },
  getLoginData: async (id) => {
    const data = await axios({
      method: 'post',
      url: 'http://localhost:666/data',
      headers: {
        token: 'test'
      },
      data: {
        id: id
      }
    })

    return data.data
  },
  login: async (id) => {
    const data = await userModel.getLoginData(id)

    let user = await dbModel.getUser(data.email)

    if (!user) {
      await dbModel.addUser({
        email: data.email,
        firstname: data.name.split(' ')[0],
        lastname: data.name.split(' ')[1]
      })

      user = await dbModel.getUser(data.email)
    }

    userModel.currentUser = user
  },
  filterLog: (log) => {
    const filteredLog = {}

    log.forEach((entry) => {
      if (entry.payed === 0 && entry.endtime) {
        const city = cityModel.getCity(entry.cityid)
        const logYear = utilitiesModel.getYear(entry.endtime)
        const logMonth = utilitiesModel.getMonth(entry.endtime)
        const logDay = utilitiesModel.getDay(entry.endtime)
        const logId = `${logYear}-${logMonth}`
        const price = utilitiesModel.calculatePrice({
          startingfee: city.startingfee,
          fee: city.fee,
          discount: city.discount,
          penaltyfee: city.penaltyfee,
          startTime: entry.starttime,
          endTime: entry.endtime,
          startPosition: entry.startparking,
          endPosition: entry.endparking
        })
        const duration = utilitiesModel.calculateDuration(entry.starttime, entry.endtime)
        const expDate = utilitiesModel.getExpDate(
          logYear, logMonth
        )

        const logEntry = {
          id: entry.id,
          year: logYear,
          month: logMonth,
          day: logDay,
          expDate: expDate,
          price: price,
          duration: duration,
          city: city.name
        }

        if (filteredLog[logId]) {
          filteredLog[logId].push(logEntry)
        } else {
          filteredLog[logId] = []
          filteredLog[logId].push(logEntry)
        }
      }
    })

    return filteredLog
  }
}

export default userModel

const cityModel = {
  allCities: [],
  getCity: (id) => {
    return cityModel.allCities.find(city => city.id === id)
  }
}

export default cityModel

const utilitiesModel = {
  calculateDuration: (startTime, endTime) => {
    const difference = endTime - startTime

    const ms2s = 1000
    const s2m = 60
    const m2h = 60

    let hours = difference / ms2s / s2m / m2h
    let minutes = (hours - Math.floor(hours)) * m2h
    let seconds = (minutes - Math.floor(minutes)) * s2m

    hours = Math.floor(hours)
    minutes = Math.floor(minutes)
    seconds = Math.floor(seconds)

    hours = (hours < 10) ? `0${hours}` : `${hours}`
    minutes = (minutes < 10) ? `0${minutes}` : `${minutes}`
    seconds = (seconds < 10) ? `0${seconds}` : `${seconds}`

    return `${hours}:${minutes}:${seconds}`
  },
  calculatePrice: (data) => {
    let totalPrice = 0
    const ms2s = 1000
    const s2m = 60

    totalPrice += data.startingfee

    const startTime = new Date(parseInt(data.startTime))
    const endTime = new Date(parseInt(data.endTime))

    const duration = Math.ceil((endTime - startTime) / ms2s / s2m)

    totalPrice += duration * data.fee

    if (data.startPosition === 'unparked' && data.endPosition === 'parked') {
      totalPrice -= data.discount
    }

    if (data.endPosition === 'unparked') {
      totalPrice += data.penaltyfee
    }

    return totalPrice
  },
  formatDate: (date) => {
    let resString = ''
    const year = date.getFullYear()
    const month = date.getMonth() + 1
    const day = date.getDate()
    const hours = date.getHours()
    const minutes = date.getMinutes()
    const seconds = date.getSeconds()

    resString += `${utilitiesModel.addZeroSmallerThan(year, 10)}-`
    resString += `${utilitiesModel.addZeroSmallerThan(month, 10)}-`
    resString += `${utilitiesModel.addZeroSmallerThan(day, 10)} `
    resString += `${utilitiesModel.addZeroSmallerThan(hours, 10)}:`
    resString += `${utilitiesModel.addZeroSmallerThan(minutes, 10)}:`
    resString += `${utilitiesModel.addZeroSmallerThan(seconds, 10)}`

    return resString
  },
  addZeroSmallerThan: (value, smallerThan) => {
    return (value < smallerThan) ? `0${value}` : String(value)
  },
  getYear: (date) => {
    date = new Date(parseInt(date))

    return date.getFullYear()
  },
  getMonth: (date) => {
    date = new Date(parseInt(date))

    return date.getMonth() + 1
  },
  getDay: (date) => {
    date = new Date(parseInt(date))

    return date.getDate()
  },
  getExpDate: (year, month) => {
    const days = '14'
    let expMonth = month + 1
    let expYear = String(year)

    if (expMonth > 12) {
      expMonth = '01'
      expYear = String(year + 1)
    } else if (expMonth < 10) {
      expMonth = `0${expMonth}`
    }

    return `${expYear}-${expMonth}-${days}`
  },
  getDaysInMonth: (invoiceCode) => {
    const year = parseInt(invoiceCode.split('-')[0])
    const month = parseInt(invoiceCode.split('-')[1])

    return new Date(year, month, 0).getDate()
  },
  getDurationInSeconds: (duration) => {
    // Time conversion
    const h2m = 60
    const m2s = 60

    const durationParts = duration.split(':')

    const hours = parseInt(durationParts[0]) * h2m * m2s
    const minutes = parseInt(durationParts[1]) * m2s
    const seconds = parseInt(durationParts[2])

    return hours + minutes + seconds
  },
  getDurationFormated: (duration) => {
    const s2m = 60
    const m2h = 60

    let hours = duration / s2m / m2h
    let minutes = (hours - Math.floor(hours)) * m2h
    let seconds = (minutes - Math.floor(minutes)) * s2m

    hours = Math.floor(hours)
    minutes = Math.floor(minutes)
    seconds = Math.floor(seconds)

    hours = (hours < 10) ? `0${hours}` : `${hours}`
    minutes = (minutes < 10) ? `0${minutes}` : `${minutes}`
    seconds = (seconds < 10) ? `0${seconds}` : `${seconds}`

    return `${hours}:${minutes}:${seconds}`
  },
  generateOCR: (customerId, invoiceId, price, corporationId) => {
    const invoiceIdConverted = invoiceId.split('-').join('')

    return `${customerId}${invoiceIdConverted}${corporationId}${price}`
  },
  getSumary: (invoice, invoiceId, customerId) => {
    const corporationId = '1234567890'
    const daysInMonth = utilitiesModel.getDaysInMonth(invoiceId)
    let totalPrice = 0
    let totalDurationInSeconds = 0
    let expDate = ''
    const fromDate = `${invoiceId}-01`
    const toDate = `${invoiceId}-${daysInMonth}`

    invoice.forEach((trip) => {
      totalDurationInSeconds += utilitiesModel.getDurationInSeconds(trip.duration)
      totalPrice += trip.price

      if (!expDate) {
        expDate = trip.expDate
      }
    })

    const duration = utilitiesModel.getDurationFormated(totalDurationInSeconds)
    const ocr = utilitiesModel.generateOCR(customerId, invoiceId, totalPrice, corporationId)

    return {
      price: totalPrice,
      duration: duration,
      expDate: expDate,
      fromDate: fromDate,
      toDate: toDate,
      ocr: ocr,
      paymentAccount: corporationId
    }
  },
  calculateCenter: (start, end) => {
    const lat = (start[0] + end[0]) / 2
    const long = (start[1] + end[1]) / 2

    return [lat, long]
  }
}

export default utilitiesModel

import m from 'mithril'

import userModel from './user'
import dbModel from './db'

const bankModel = {
  paymentMethods: [
    { value: 'Direct', text: 'Direkt' },
    { value: 'Monthly', text: 'Månad' }
  ],
  accounts: [
    {
      name: 'Lönekonto',
      clearing: '6896',
      account: '186 159 123',
      amount: 5687
    },
    {
      name: 'Buffertkonto',
      clearing: '6895',
      account: '186 669 333',
      amount: 28963
    },
    {
      name: 'ISK',
      clearing: '6897',
      account: '133 713 370',
      amount: 666
    }
  ],
  transferPrice: 600,
  transferAmount: '',
  currentAmount: null,
  currentAccount: 0,
  errorMessage: null,
  transfer: async () => {
    const transferSum = parseInt(bankModel.transferAmount) + bankModel.transferPrice

    userModel.currentUser = await dbModel.getUser(userModel.currentUser.email)

    let balance = userModel.currentUser.balance

    if (
      transferSum <= bankModel.accounts[bankModel.currentAccount].amount &&
            parseInt(bankModel.transferAmount) > 0
    ) {
      bankModel.accounts[bankModel.currentAccount].amount -= transferSum
      await dbModel.updateUser({ balance: balance += parseInt(bankModel.transferAmount) })
      userModel.currentUser = await dbModel.getUser(userModel.currentUser.email)

      bankModel.transferAmount = ''

      m.route.set('/bank/proccessing')

      setTimeout(() => {
        m.route.set('/user')
      }, 2000)
    } else {
      bankModel.accounts[bankModel.currentAccount].amount -= bankModel.transferPrice

      if (bankModel.accounts[bankModel.currentAccount].amount < 0) {
        bankModel.accounts[bankModel.currentAccount].amount = 0
      }

      bankModel.errorMessage = {
        view: () => {
          if (transferSum > bankModel.accounts[bankModel.currentAccount].amount) {
            return [
              m('fieldset.bank-error-message-div', [
                m('legend', 'Error!'),
                m('p', 'För stor överföring!'),
                m('p', `
                                    Högsta tillåtna överföring är
                                    ${
                                        (
                                            bankModel.accounts[bankModel.currentAccount].amount -
                                            bankModel.transferPrice < 0
                                        )
                                            ? 0
                                            : bankModel.accounts[bankModel.currentAccount].amount -
                                            bankModel.transferPrice
                                    } SEK.
                                `),
                m('p', 'Vi drar ändå vår avgift för att du slösar vår tid.')
              ])
            ]
          } else {
            return [
              m('fieldset.bank-error-message-div', [
                m('legend', 'Error!'),
                m('p', 'För liten överföring!'),
                m('p', ' Överföring måste vara större än 0!'),
                m('p', 'Vi drar ändå vår avgift för att du slösar vår tid.')
              ])
            ]
          }
        }
      }

      setTimeout(() => {
        bankModel.errorMessage = null
      }, 5000)
    }
  },
  pay: async (invoice) => {
    let totalPrice = 0
    await invoice.map(async (trip) => {
      totalPrice += trip.price

      await dbModel.updateLogPayed({
        id: trip.id,
        payed: 1
      })
    })

    bankModel.accounts[bankModel.currentAccount].amount -= totalPrice

    m.route.set('/bank/proccessing')

    setTimeout(() => {
      m.route.set('/history')
    }, 2000)
  }
}

export default bankModel
